import React, {Component} from 'react';

class Cart extends Component {
    render() {
        return (
            <div className="cart">
                <ul>
                    <li>Lorem.</li>
                    <li>Unde?</li>
                    <li>Delectus.</li>
                    <li>Ipsa?</li>
                    <li>Odit.</li>
                </ul>
            </div>
        );
    }
}

export default Cart;
